import React from 'react';

function Round_progress({ colour, value, border }) {
  return (
    <div>
      <div className="w-max relative m-8">
        <div className={`bg-white rounded-full p-6 border-4 ${border}`}>
          <div className={`${colour} p-5 rounded-full`}>
            <div className="bg-white rounded-full w-22 h-20 flex flex-col justify-center items-center">
              <p className="text-black text-2xl font-bold" style={{ fontSize: '12px' }}>{value}</p> {/* Adjust font size here */}
              <p className="text-slate-500 font-medium smaller-text" style={{ fontSize: '14px' }}>PM 2.5</p> {/* Adjust font size here */}
            </div>
          </div>
        </div>
        <div className="absolute top-1/2 right-[-3px]">
          <div className={`bg-${colour} rounded-full p-[1px] border-2 ${border}`}>
            <div className=" bg-white p-[2px] rounded-full"></div>
          </div>
        </div>
        <div className="absolute top-1/2 left-[-3px]">
          <div className={`bg-${colour} rounded-full p-[1px] border-2 ${border}`}>
            <div className=" bg-white p-[2px] rounded-full"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Round_progress;
